import React from "react";
import "./homeStyle.css";

function Home() {
  const priorityDummy = [
    {
      id: 0,
      icon: () => (
        <Ionicons
          name="arrow-up"
          size={moderateScale(17)}
          style={{ color: "#C03630" }}
        />
      ),
      title: "Highest",
      active: true,
    },
    {
      id: 1,
      icon: () => (
        <Ionicons
          name="arrow-up"
          size={moderateScale(17)}
          style={{ color: "#FF706A" }}
        />
      ),
      title: "High",
      active: false,
    },
    {
      id: 2,
      icon: () => (
        <Ionicons
          name="arrow-down"
          size={moderateScale(17)}
          style={{ color: "#1A7D5A" }}
        />
      ),
      title: "Low",
      active: false,
    },
    {
      id: 3,
      icon: () => (
        <Ionicons
          name="arrow-down"
          size={moderateScale(17)}
          style={{ color: "#28B446" }}
        />
      ),
      title: "Lowest",
      active: false,
    },
  ];
  return (
    <div className="home">
      <div className="listContainer">
        <h2>Account List</h2>
        <div className="card">
          <div className="accNumber">account number</div>
          <div className="lowerSectCard">
            <div>balance</div>
            <div>last transaction</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
